import React from 'react';


function Button (props){
    
    return(
        <React.Fragment>
           
                <button 
                    className= {props.classname}
                    onClick = {()=>props.onclick()}
                    title = {props.title}
                    type = {props.type}
                    tabIndex = {props.tabindex}
                >    
                        {props.name} 

                </button>

        </React.Fragment>
    )
}

export default Button
